// src/admin/AdminContact.js
import React from 'react';
import './AdminContact.css';
import { useNavigate } from 'react-router-dom';

const AdminContact = () => {
  const navigate = useNavigate();

  const handleNavigate = (path) => {
    navigate(path);
  };

  return (
    <div className="admin-contact">
      <div className="navbar">
        <span className="brand" onClick={() => handleNavigate('/admin-home')}>B.Planet</span>
        <div className="nav-links">
          <span className="nav-link" onClick={() => handleNavigate('/contact-us')}>Contact Us</span>
          <span className="nav-link" onClick={() => handleNavigate('/login')}>Login</span>
          <img src="../photos/profile.jpg" alt="Profile" className="profile-pic" onClick={() => handleNavigate('/profile')} />
        </div>
      </div>
      <div className="contact-content">
        <h2>Contact Us</h2>
        <div className="contact-box">
          <div className="left-box">
            <h3>Stay Updated</h3>
            <p>Subscribe to our newsletter and stay updated on the latest developments and special offers!</p>
            <p>Address: 1234 Street, City, Country</p>
            <p>Phone: (123) 456-7890</p>
            <p>Email: info@bplanet.com</p>
          </div>
          <div className="right-box">
            <form className="contact-form">
              <div className="form-field">
                <input type="text" placeholder="Name" />
              </div>
              <div className="form-field">
                <input type="email" placeholder="Email" />
              </div>
              <div className="form-field">
                <textarea placeholder="How can we help?"></textarea>
              </div>
              <button type="submit">Submit</button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AdminContact;
